window.bookSummaryJSON = "<p><b><i>USA TODAY </i></b><b>&amp; Amazon three million copy best-selling author BLAKE BANNER is at his best with his original action-packed thriller series!</b><br> <br> SAS veteran Lacklan Walker has been searching for Marni.<br> <br> She murdered his father, but his father’s dying wish was that Lacklan should keep her safe; safe from Omega, the government-within-the government, whose plans for humanity Marni has sworn to expose. And that is anything but safe.<br> <br> Now the UN in New York is hosting an international conference on global warming and overpopulation. Marni will be delivering a key paper. Lacklan knows that paper will be dynamite, and Omega will be gunning for her. What he doesn’t know is that Abdul Abbassi, the Butcher of Helmand, is also there, and his intention is not to keep anybody safe. His intention is to rain bloody fire and death down on the conference – and the city.<br> <br> Long ago Lacklan swore to kill Abbassi, now is his chance, but time is running out and if he is to save Marni - and thousands more–he will have to play a dangerous double game with Omega: Omega of the Dark Agenda, Omega, who move the subtle Hand of War....</p>"; 
